        <h1>A beetle got in the door last night.</h1>
        <p class="punchline">
          I asked my wife, jokingly, which one...John, Paul, George, or Ringo. She said, "one that is lucky I'm going to put it outside instead of
          kill it." I replied, "so...not John..."
